ISLAMABAD, Jun 11 (APP):Prime Minister Imran Khan on Thursday was presented Economic Survey 2019-20 as the government is all set to announce the federal budget for the next fiscal year on Friday.
Adviser to PM on Finance Dr Abdul Hafeez Sheikh presented the copy of Economic Survey to the Prime Minister in a meeting held here, the PM Media Wing said.
